export const Gifs = () => {
  const [query, setQuery] = useState();

  const URL = `https://api.giphy.com/v1/gifs/random?api_key=yCnioK74PGeBPMDOX6IyK823iBW8qNXn&tag=&rating=g`;

  const hundleOnSumbit = (e) => {
    e.preventDefault();
    axios
      .get(URL)
      .then((res) => {
        setQuery(res.data.data);
      })
      .catch((err) => console.log(err));
  };
  console.log(query.image_mp4_url)

  return (
    <Container>
      <Row>
